import React, { Component } from "react";
import { Section, StyledButton } from "../Components";
import Card from "../Components/Card";

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div>
          <Section primary>
            <div
              style={{ fontSize: "3em", fontWeight: "bold" }}
            >{`We <3 people who code`}</div>
            <div
              style={{
                fontSize: "1.3em",
                maxWidth: "350px",
                textAlign: "center",
                margin: "2%",
              }}
            >
              We build products that empower developers and connect them to
              solutions that enable productivity, growth, and discovery.
            </div>
            <div style={{ display: "flex", flexDirection: "row", flex: 1 }}>
              <StyledButton developer> For Developers</StyledButton>
              <StyledButton> For Buisness</StyledButton>
            </div>
          </Section>
        </div>
        <div>
          <Section>
            <div
              style={{ fontSize: "2em", fontWeight: "bold" }}
            >{`For developers, by developers`}</div>
            <div
              style={{
                width: "70px",
                height: "10px",
                background: "#f28033",
                borderRadius: "5px",
                marginTop: "2%",
              }}
            ></div>
            <div
              style={{
                fontSize: "1.1em",
                maxWidth: "550px",
                textAlign: "center",
                margin: "2%",
              }}
            >
              Stack Overflow is an open community for anyone that codes. We help
              you get answers to your toughest coding questions, share knowledge
              with your coworkers in private, and find your next dream job.
            </div>
            <div style={{ display: "flex", flexDirection: "row", flex: 1 }}>
              <Card />
            </div>
          </Section>
        </div>
      </>
    );
  }
}

export default Homepage;
